objet:
DE RASSEMBLER DES BENEVOLES EN PARTICULIER DES ANTILLES
DE FAIRE CONNAITRE NOS DANSES ET NOS TRADITIONS;
DE DEVELOPPER CES ACTIONS

-Créer un espace d'échange confraternel entre professionnels de santé;
-Parrainer et accompagner les étudiants;
-Proposer des séances de mise à jour des connaissances scientifiques dans les différentes disciplines liées à la santé;
-Promouvoir les médecines douce et traditionnelles qui favorisent une approche globale du patient;
-Améliorer le bien-être individuel et collectif par des campagnes de prévention et d'éducation.

-De développer des relations sociales, des pratiques démocratiques et la communication dans l'établissement;
-De favoriser le développement de la personnalité de chacun et l'exercice de la citoyenneté;
-D'impulser des actions collectives, d'entraide et de solidarité, de valoriser la créativité, l'initiative, l'esprit d'équipe et d'entreprise;
-De favoriser l'expression des individus et des groupes dans la limite du respect des personnes et des biens;
-De lutter contre toute discrimi

- de regrouper et représenter ses associations affiliées auprès des groupes La Poste et Orange et de leurs filiales ;
- d'assurer le soutien et le développement de ses associations affiliées en effectuant, auprès des groupes La Poste et Orange et de leurs filiales, notamment les missions de concertation et de négociation propres à assurer le fonctionnement et l'avenir des associations affiliées ;
- d'assurer l'animation du réseau entre les associations affiliées et entre la fédération nationale et les associations affiliées ;
- d'organiser les liens entre ses membres notamment au moyen de diverses publications et manifestations artistiques ;
- de promouvoir les activités d'arts plastiques et ainsi oeuvrer à l'enrichissement culturel des personnes de ces deux groupes en organisant notamment des salons artistiques régionaux et nationaux.

mener une action de recherche, de création, d'écriture, de diffusion, de formation, danimation et déchange dans les domaines suivants :
Expression dramatique : théâtre, contes, poésie ;
des arts plastiques sous toutes leurs formes ;
l'expression audiovisuelle et musicale et l'infographiee

- oeuvrer au mieux vivre ensemble dans les villes et quartiers de résidence ;
- développer des ateliers créatifs et des rencontres intergénérationnelles ;
- asseoir et organiser des familles d'accueil pour les enfants et les jeunes, notamment ceux en provenance de la Côte d'Ivoire, pour des raisons médicales
- lutter contre l'abandon des enfants et les sévices de tout genre auxquels ils sont soumis et leur garantir une croissance normale ;
- permettre à tous les jeunes d'accéder à l'éducation de qualité et à la bonne santé ; 
- combattre la faim et la malnutrition des jeunes ;
- promouvoir des actions d'autonomisation de ces jeunes et des femmes ;
- sensibiliser l'opinion internationale au drame qui frappe les enfants et les jeunes dans ce pays, et, entreprendre des actions pour endiguer ce fléau

l'association a pour but, dans le respect du droit français d'une part, des accords conclus en son sein d'autre part de : promouvoir et redécouvrir la culture et l'art numérique sous toutes ses formes
participer à l'émancipation et à l'éveil artistique de chacun à travers différents ateliers, évènements (concert, séminaire, soirée
) qui feront appel à des disciplines tels que la danse, le chant, le théâtre, la photo, la vidéo, le chant, la peinture, langage, les jeux, la cuisine, la musique
 ; se comporter comme une agence artistique, éducationnelle et évènementielle afin de développer une culture économique et un réseau d'entraide inter adhérents
canaliser une dynamique et une énergie commune dans des activités ponctuelles, et à but pédagogique en termes d'organisation, de responsabilité, d'initiative ; grâce à l'échange, la solidarité et l'entraide, de permettre aux populations sinistrées et découragées à cause de difficultés de vies rencontrées, de trouver une oreille voire même des solutions concrètes par la e-integration ; solidifier les relations humaines entre les différents membres adhérents et sympathisants ou chacun va apprendre et apporter à l'autre ; recréer et maintenir un esprit de solidarité intergénérationnel ; d'apporter son concours aux pouvoirs publics par la réalisation d'uvres sociales, humanitaires et caritatives (écoles, orphelinats, dispensaires, épicerie sociales, potagers
) , notamment de récolter des fonds pour soutenir la construction de structure en france et à l'international, plus particulièrement en afrique et aux antilles permettre à l'association de se faire connaître sous un aspect convivial et ludique ; a cette fin, l'association pourra se livrer à toute activité se rapportant directement ou indirectement, à la formation et à la culture numérique sous toutes ses formes ; elle pourra réaliser certaines activités parallèles telles que l'accueil, la création artistique, la mise à disposition de locaux, services de communication et services audiovisuels et d'une manière générale se livrer à toute activité de quelque nature que ce soit, en lien avec son objet principal ; elle pourra passer convention avec l'état, les collectivités territoriales ainsi qu'avec tout organisme concourant même partiellement à son objet ;

produire des groupes de musique et de danse lors de concerts festivals;
Manifestations organisées par les Municipalités et autres organismes.
Organiser, gérer des soirées concerts spectacles.

Apporter une connaissance objective de la culture arabo-musulmane;
Favoriser les échanges culturels par le biais de conférences et de rencontres; 
Promouvoir des ouvrages concernant cette culture;
Edition Impression Distribution de ces ouvrages;
Traduction et étude de manuscrits.

Développer un tourisme socio-écologique, selon une perspective de développement durable;
Faire voir et comprendre les réalités guinéennes aux touristes étrangers;
Permettre des échanges culturels entre les populations du Nord et du Sud;
Encourager l'emploi dans les milieux enclavés, pour les jeunes et les femmes;
Limiter l'exode rural;
Promouvoir la destination Guinée ainsi que la culture Guinnéenne.

Création et representation de spectacles : pièces de théatres, concerts, récitals, ballets, pantomimes, spectacles de rue, performances...
Création, organisation et montage d'ateliers pédagogiques à destination du grand public ou de professionnels;
Organisation et participation à des échanges culturels de tous types avec d'autres structures privées, publiques ou para-publiques nationales, étrangères ou internationales;
Mise en place, utilisation, distribution et vente de tous moyens...

Contribuer à rendre accessibles les contenus et les enjeux de la connaissance scientifique aux yeux des citoyens afin de favoriser la prise de responsabilité de ces derniers à l'égard de ces enjeux;
Ouvrir à tous l'activité scientifique à travers des pratiques qui montrent que chacun peut faire de la science et qui donnent envie d'en faire;
Contribuer aussi à ouvrir les quartiers dits sensibles en contrecarrant le sentiment d'enfermement culturel et social ressenti par trop de jeunes de ce

Aider au financement des différents projets au développement économique, social et culturel de notre village;
Améliorer le cadre de vie de la communauté villageoise;
Lutter contre l'éxode rural;
Aider à la défense des intérêts matériels et moraux des ressortissants de Lagoguhe en Côte d'Ivoire;
Developper les actions de solidarité entre les ressortissants de Lagoguhe ici en France

défendre un art et une culture engagé dans les enjeux humains de notre époque par :
La création et diffusion de spectacles, de documents audio-visuels, d'expositions;
L'animation d'ateliers de création : théâtre, musique, techniques de cinéma et de pré-cinéma;
La participation aux conférences, débats, manifestations culturelles;
La formation dans le domaine de la culture et de la vie associative.

promouvoir la culture traditionnelle et contemporaines, guyanaises
contribuer à faire connaître nos artistes, la musique guyanaise et aider à la conservation du patrimoine
organiser et animer tout événement associatif s'associer à toutes organisations et confédérations chargées de promouvoir la culture ;

- dialogue interculturel ; - actions sociales et culturelles ; - economie sociale et solidaire (aide à la création d'emplois et d'entreprises, mise à disposition de compétence pour appels à projets et la recherche de financement, accompagnement pour la réinsertion socio-professionnelle, prévention des expulsions ; ; ; ) ; - partenariats associatifs axés sur le développement durable et la lutte contre la pauvreté ; pour cela l'association utilisera tous les moyens possibles tel que : - les publications, les cours, les conférences, les réunions de travail
- l'organisation de manifestations et toute initiative pouvant aider à la réalisation de l'objet de l'association
- la vente permanente ou occasionnelle de tous produits ou services entrant dans le cadre de son objet ou susceptible de contribuer à sa réalisation ;

-	de créer, de maintenir et de resserrer les liens de solidarité, d'amitié et d'entraide entre les membres de l'association et les diplômés de l'l ; s ; g ; -	d'étudier toutes les questions qui concernent les ingénieurs diplômés de l'institut galilée'
-	de prendre toutes mesures jugées nécessaires pour la reconnaissance et le rayonnement - en france et à l'étranger- du diplôme d'ingénieur délivré par l'institut galilée
-	de collaborer en synergie et dans un esprit de partenariat avec l'institut galilée ; (direction, equipe pédagogique, élèves, associations, etc ; ) pour la promotion et l'amélioration continue du diplôme d'ingénieur de l'institut galilée ; -	de veiller à la qualité et au niveau des matières qui sont enseignées dans la formation d'ingénieurs de l'institut galilée ; -	de s'intéresser à toute question technique, économique ou sociale touchant le secteur des technologies de l'information et de la communication, des matériaux, du génie logiciel, des mathématiques appliquées et du calcul scientifique par les connaissances des membres de l'association ;

promouvoir les arts en espace public et pour missions une mission artistique : par l'accompagnement de la production et de la création en espace public : - soutenir la création par un accompagnement, des apports en coproduction, un accueil en résidence de compagnies ou d'artistes ; - développer les productions sous forme d'apports numéraires au bénéfice des compagnies ou par des productions déléguées ; - assurer la mise en place de résidences artistiques au moulin fondu ;
- inciter la mise en relation avec d'autres structures culturelles, ouvrant sur les autres domaines artistiques ; par l'accompagnement de la compagnie oposito : - administrer au quotidien la compagnie et gérer ses activités
- développer sa diffusion nationale et internationale - entretenir son répertoire et préserver son patrimoine une mission territoriale - promouvoir une diffusion régulière de spectacles et de propositions artistiques dans l'espace public par des saisons arts de la rue, au-delà des festivals et des temps forts ; - mettre en place des résidences de diffusion investissant le territoire ; - établir des partenariats avec d'autres structures de diffusion ; - participer aux réseaux professionnels : régionaux, nationaux et internationaux ; une mission en direction des publics
- promouvoir des formes innovantes de rencontres entre actes artistiques et populations ; - créer une dynamique de rencontre et d'échange entre les publics, les artistes et leurs uvres ; - contribuer à forger des regards nouveaux sur les arts de la rue et ses évolutions par la mise en synergie entre les actions de soutien à la création, la diffusion et l'action culturelle ; - développer de nouvelles formes de médiation ; - mettre en place des actions de sensibilisation pour des publics spécifiques en synergie avec les missions artistiques (production et diffusion) ; - animer des rencontres, colloques et débats ouverts vers des publics plus larges afin d'améliorer la connaissance des arts de la rue ; une mission de production déléguée pour des artistes en devenir et/ou des jeunes compagnies en structuration
- s'engager sur du long terme à accompagner des compagnies en création ou en structuration - assurer un travail d'accompagnement conseil pour aboutir à la création et à la mise en ordre de marche du dispositif administratif concordant avec son activité et ses créations de jeunes artistes, sur un programme annuel pouvant être renouvelé plusieurs fois ; -assurer la production déléguée des projets de création, de leur diffusion, voire de leur reprise l'année suivante ; conformément à l'arrêté du 5 mai 2017 fixant le cahier des missions et des charges relatives au label « centre national des arts de la rue et de l'espace public », une part des budgets de production et de diffusion du cnarep pourra être consacrée aux créations de la compagnie oposito ; cette part ne peut être majoritaire ni en montant financier, ni en nombre d'uvres produite et/ou diffusée sur la durée de la convention pluriannuelle d'objectifs ;
